self.onDataUpdated = function(){
    var dashboard = self.ctx;
    var dataArray = dashboard.data;
    let valorPos = [0,0];
    for(var i = 0; i < dataArray.length;i++){
        
        var valorPosArray = dataArray[i].data[0];
        
        valorPos[i] = valorPosArray && valorPosArray[1];
    }
    agregar(valorPos[0],valorPos[1]);
    
}
self.onInit = function() {
    c1 = document.getElementById("canvas1");
    c2 = document.getElementById("canvas2");
    ctx1 = c1.getContext("2d");
    ctx2 = c2.getContext("2d");

    heat = simpleheat(c1);
    // set point radius and blur radius
    heat.radius(15, 15);
    // set max data value
    heat.max(1);
    
    //Crear la imagen de fondo
    img = new Image();
    img.src = "https://i.ibb.co/0cGKSWh/Planos-salon-1.png";
    
    
    const button = document.querySelector("input");
    button.addEventListener("click", cliqueado);
    function cliqueado(){
        console.log("hola");
        var a = getRandomArbitrary(0,640);
        var b = getRandomArbitrary(0,366);
        agregar(a,b);
    }
    
    
    img.onload = function(){
        //dibujar la imagen, formato (img, margen1,margen2,ancho,alto)
        dibujar();
        ctx2.drawImage(img, 0, 0,640 ,366);
    }
    
    
}

function getRandomArbitrary(min, max) {
  return Math.random() * (max - min) + min;
}

function dibujar(){
    heat.data(data);
    // draw the heatmap with optional minimum point opacity
    heat.draw();
    }

function agregar(coordX,coordY){
        let a = coordX;
        let b = coordY;
        if(!zonaProhibida(a,b)){
            heat.add([coordX,coordY,1]);
            heat.max(heat.getMax()+0.1);
            heat.draw();
        }
        else{
            enviarError();
        }
}

enviarError = function() {
        var rpcMethod = "setLedStatus";
        var rpcParams = "true";
        var timeout = self.ctx.settings.requestTimeout;
        var oneWayElseTwoWay = self.ctx.settings.oneWayElseTwoWay ? true : false;

        var commandObservable;
        if (oneWayElseTwoWay) {
            commandObservable = self.ctx.controlApi.sendOneWayCommand(rpcMethod, rpcParams, timeout);
        } else {
            commandObservable = self.ctx.controlApi.sendTwoWayCommand(rpcMethod, rpcParams, timeout);
        }
        commandObservable.subscribe(
            function (response) {
                if (oneWayElseTwoWay) {
                    self.ctx.$scope.rpcCommandResponse = "Command was successfully received by device.<br> No response body because of one way command mode.";
                } else {
                    self.ctx.$scope.rpcCommandResponse = "Response from device:<br>";                    
                    self.ctx.$scope.rpcCommandResponse += JSON.stringify(response, undefined, 2);
                }
                self.ctx.detectChanges();
            },
            function (rejection) {
                self.ctx.$scope.rpcCommandResponse = "Failed to send command to the device:<br>"
                self.ctx.$scope.rpcCommandResponse += "Status: " + rejection.status + "<br>";
                self.ctx.$scope.rpcCommandResponse += "Status text: '" + rejection.statusText + "'";
                self.ctx.detectChanges();
            }
            
        );
    }


function zonaProhibida(coordX,coordY){
    let bool = false;
    //LLENAR ARRAY CON: [X VERTICE ARRIBA A LA IZQ,Y VERTICE ARRIBA A LA IZQ,X VERTICE ABAJO A LA DER,Y VERTICE ABAJO A LA DER,..]
    var zonasProhibidas = [0,0,640,14,0,0,14,366,0,353,640,366,625,0,640,366,224,12,593,64,129,138,549,227,224,303,594,355];
    
    for (let i = 0; i < zonasProhibidas.length; i += 4) {
        let izq = zonasProhibidas[i];
        let arr = zonasProhibidas[i+1];
        let der = zonasProhibidas[i+2];
        let ab = zonasProhibidas[i+3];
        
        if(coordX > izq && coordX < der && coordY > arr && coordY < ab){
            bool = true;
        }
    }
    return bool;
}
    
function simpleheat(canvas) {
    if (!(this instanceof simpleheat)) return new simpleheat(canvas);

    this._canvas = canvas = typeof canvas === 'string' ? document.getElementById(canvas) : canvas;

    this._ctx = canvas.getContext('2d');
    this._width = canvas.width;
    this._height = canvas.height;

    this._max = 1;
    this._data = [];
}

simpleheat.prototype = {

    defaultRadius: 25,

    defaultGradient: {
        0.4: 'blue',
        0.6: 'cyan',
        0.7: 'lime',
        0.8: 'yellow',
        1.0: 'red'
    },

    data: function (data) {
        this._data = data;
        return this;
    },
    
    getMax: function () {
        return this._max;
    },
    
    max: function (max) {
        this._max = max;
        return this;
    },

    add: function (point) {
        this._data.push(point);
        return this;
    },

    clear: function () {
        this._data = [];
        return this;
    },

    radius: function (r, blur) {
        blur = blur === undefined ? 15 : blur;

        // create a grayscale blurred circle image that we'll use for drawing points
        var circle = this._circle = this._createCanvas(),
            ctx = circle.getContext('2d'),
            r2 = this._r = r + blur;

        circle.width = circle.height = r2 * 2;

        ctx.shadowOffsetX = ctx.shadowOffsetY = r2 * 2;
        ctx.shadowBlur = blur;
        ctx.shadowColor = 'black';

        ctx.beginPath();
        ctx.arc(-r2, -r2, r, 0, Math.PI * 2, true);
        ctx.closePath();
        ctx.fill();

        return this;
    },

    resize: function () {
        this._width = this._canvas.width;
        this._height = this._canvas.height;
    },

    gradient: function (grad) {
        // create a 256x1 gradient that we'll use to turn a grayscale heatmap into a colored one
        var canvas = this._createCanvas(),
            ctx = canvas.getContext('2d'),
            gradient = ctx.createLinearGradient(0, 0, 0, 256);

        canvas.width = 1;
        canvas.height = 256;

        for (var i in grad) {
            gradient.addColorStop(+i, grad[i]);
        }

        ctx.fillStyle = gradient;
        ctx.fillRect(0, 0, 1, 256);

        this._grad = ctx.getImageData(0, 0, 1, 256).data;

        return this;
    },

    draw: function (minOpacity) {
        if (!this._circle) this.radius(this.defaultRadius);
        if (!this._grad) this.gradient(this.defaultGradient);

        var ctx = this._ctx;

        ctx.clearRect(0, 0, this._width, this._height);

        // draw a grayscale heatmap by putting a blurred circle at each data point
        for (var i = 0, len = this._data.length, p; i < len; i++) {
            p = this._data[i];
            ctx.globalAlpha = Math.min(Math.max(p[2] / this._max, minOpacity === undefined ? 0.05 : minOpacity), 1);
            ctx.drawImage(this._circle, p[0] - this._r, p[1] - this._r);
        }

        // colorize the heatmap, using opacity value of each pixel to get the right color from our gradient
        var colored = ctx.getImageData(0, 0, this._width, this._height);
        this._colorize(colored.data, this._grad);
        ctx.putImageData(colored, 0, 0);

        return this;
    },

    _colorize: function (pixels, gradient) {
        for (var i = 0, len = pixels.length, j; i < len; i += 4) {
            j = pixels[i + 3] * 4; // get gradient color from opacity value

            if (j) {
                pixels[i] = gradient[j];
                pixels[i + 1] = gradient[j + 1];
                pixels[i + 2] = gradient[j + 2];
            }
        }
    },

    _createCanvas: function () {
        if (typeof document !== 'undefined') {
            return document.createElement('canvas');
        } else {
            // create a new canvas instance in node.js
            // the canvas class needs to have a default constructor without any parameter
            return new this._canvas.constructor();
        }
    }
};

